        public List<DB.RangeInfo> RDBs = new List<DB.RangeInfo>();

        public bool DBReady { get; set; } = false;

        public void InitDB(string customDBStr)
        {
            foreach (string dbr in customDBStr.Split(';'))
            {
                string[] raw_row = dbr.Split(',');
                if (raw_row.Length != 3 && raw_row.Length != 2)
                    continue;

                DB.RangeInfo tmp_rif = new DB.RangeInfo()
                {
                    Start_index = Convert.ToInt32(raw_row[0], 16),
                    End_index = Convert.ToInt32(raw_row[raw_row.Length - 2], 16),
                    Type = DB.StrEAW[raw_row[raw_row.Length - 1]]
                };

                RDBs.Add(tmp_rif);
            }
            DBReady = true;
        }

        public void InitDB()
        {
            InitDB(DEFAULT_DB_STRING);
        }
